.section-portfolio {
  padding: 84px 0;
  @media screen and (min-width: $tablet) {
    padding: 100px 0;
  }
  @media screen and (min-width: 1280px) {
    padding: 130px 0;
  }
}
.container-portfolio {
  @media screen and (min-width: 768px) {
    width: 768px;
    padding-left: 40px;
    padding-right: 40px;
  }
  @media screen and (min-width: 1280px) {
    width: 1280px;
    padding-left: 55px;
    padding-right: 55px;
  }
}

.row {
  display: flex;
  justify-content: flex-start;
  align-items: flex-start;
}

.line {
  width: 60px;
  height: 1px;
  margin-top: 10px;
  margin-right: 20px;
  background-color: $text-title-color;
}

.subtitle {
  display: inline-flex;
  font-family: Open Sans;
  font-style: normal;
  font-weight: 600;
  font-size: 11px;
  line-height: 21px;
  letter-spacing: 0.1em;
  text-transform: uppercase;
  color: $text-title-color;
}

.container-photo {
  padding-top: 44px;
  @media screen and (min-width: 768px) {
    margin-right: -30px;
    margin-left: -30px;
  }
  @media screen and (min-width: 1280px) {
    margin-right: -55px;
    margin-left: -55px;
  }

  & .list {
    list-style: none;
    margin: -30px;
    @media screen and (min-width: 768px) {
      display: flex;
      flex-wrap: wrap;
      justify-content: center;
      margin: -15px;
    }
  }
}

.container-photo .item {
  display: block;
  text-align: center;
  margin: 30px;

  @media screen and (min-width: 768px) {
    margin: 15px;
    width: calc((100% - 4 * 30px) / 2);
  }
  @media screen and (min-width: 1280px) {
    margin: 15px;
    width: calc((100% - 8 * 30px) / 4);
  }
}
